  menuToggle.classList.toggle('active');
  showcase.classList.toggle('active');
})
  return (
    <div>
          <h1>Hi, I'm Jeff</h1>
		  <h2> A Full-Stack Web Developer </h2>
    </div>
  );
}

export default App
